import React from 'react'
import Button from "@mui/material/Button";
import TextField from '@mui/material/TextField';
const HOME = () => {

return(
<>
  
  
  <div className="container">
            <div className="Input">
              <h2 style={{ marginLeft: "10px" }}>Loan Calculator Dashboard</h2>
              <TextField label="Loan Amount" variant="outlined" />
              <TextField label="Interest Rate (%)" variant="outlined" sx={{ marginLeft: "20px" }}/>
              <TextField label="Loan Tenure (Years)" variant="outlined" sx={{ marginLeft: "20px" }}/>
            </div>

            <Button className="button" variant="contained" sx={{ marginTop: "20px" }}>
              calculate
            </Button>
          </div>
</>
);
}

export default HOME;
